import Container from '@material-ui/core/Container';
import {Switch, Route} from 'react-router-dom';
import Map from './components/Map';
import './App.css';


function App() {
  return (
    <Container >
      <Switch>
        <Route exact path = "/">
          <Map/>
        </Route> 
      </Switch>

    </Container>
  );
}

export default App;
